Solve the following math problem: If the radius of a circle is doubled, how does the area change?
Answer: When the radius of a circle is doubled, the area increases by a factor of four. This is because the area of a circle is given by the formula \(A = \pi r^2\), where \(r\) is the radius of the circle. If the original radius is \(r\), doubling it results in a new radius of \(2r\). The new area, then, would be \(A' = \pi (2r)^2 = 4\pi r^2\). This shows that the new area is four times the original area, due to the square relationship between the radius and the area.

